import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Typography, Spin, Alert } from "antd";
import { getUserProfile } from "../../redux/actions/productActions";
import { Avatar, Box, Container, Grid } from "@mui/material";

const UserProfile = () => {
  const dispatch = useDispatch();

  const userProfile = useSelector((state) => state.userProfile);
  const { loading, error, data } = userProfile;
  console.log(data);

  useEffect(() => {
    dispatch(getUserProfile());
  }, [dispatch]);

  return (
    <div>
      {loading && <Spin />}
      {error && (
        <Alert message="Error" description={error} type="error" showIcon />
      )}
      <Container>
        <Grid row container>
          <Grid item xs={12} md={6} lg={6}>
            <Box sx={{ p: 1, boxShadow: 2, m: 2 ,borderRadius:'10px'}}>
              {data && (
                <div>
                  <Avatar
                    alt={data.user.username}
                    src={data.user.profilePicture}
                    sx={{ width: 100, height: 100 }}
                  />
                  <Typography.Title level={2}>User Profile</Typography.Title>
                  <Typography.Paragraph>
                    <strong>Name:</strong> {data.user.username}
                  </Typography.Paragraph>
                  <Typography.Paragraph>
                    <strong>Email:</strong> {data.user.email}
                  </Typography.Paragraph>
                  <Typography.Paragraph>
                    <strong>Bio:</strong> {data.user.bio}
                  </Typography.Paragraph>
                  <Typography.Paragraph>
                    <strong>profession :</strong> {data.user.profession}
                  </Typography.Paragraph>
                </div>
              )}
            </Box>
          </Grid>
          <Grid item xs={12} md={6} lg={6}></Grid>

        </Grid>
      </Container>
    </div>
  );
};

export default UserProfile;
